import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    fetch("https://bpm-projects-api.azurewebsites.net/projects/", {
      method: "GET",
      headers: new Headers({
        "Content-Type": "application/json"
      })
    })
      .then(results => results.json())
      .then(data => {
        console.log(data);
        this.setState({ projectList: data.results });
      });
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
